import React from 'react';
import HomeScreen from  './screens/home';
import { Switch, Route} from 'react-routes-dom';

const Routes = () => {
    <Switch>
        <Route exact patch='/' component={HomeScreen}/>
    </Switch>
}

export default Routes;
